- Mais 9 REDUÇÕES permanentes de tributos:

1.Fim do imposto federal do gás liquefeito de petróleo (GLP) / gás de cozinha.

2.Redução 25% IPI;

3.Redução ICMS combustível, energia, telefonia e internet para 17%.

4.Redução DPVAT;

5.Fim gradual IOF câmbio;

6.Fim adicional 10% multa FGTS;

7.Redução das taxas CVM;

8.Redução do Adicional ao Frete para Renovação da Marinha Mercante (AFRMM);

9.Redução: 20% Tarifa Externa Comum (TEC MERCOSUL) e do regime tarifário de Bens de Capital e Bens de Informática e Telecomunicações (BIT BK);

