- Mais dados sobre o Governo Federal e a SEGURANÇA:

- HOMICÍDIOS - MORTES VIOLENTAS INTENCIONAIS

. A média anual de mortes violentas intencionais intencionais caiu de 61 mil anuais (2015–2018, Governos Dilma e Temer) para 48 mil anuais (2019–2021, Governo Bolsonaro);

. Em relação ao período de 2011 a 2014 (Governo Dilma), a média anual de mortes violentas intencionais do período de 2015 a 2018 (Dilma/Temer) havia crescido em 12%; já entre 2019 e 2021 (Governo Bolsonaro), a média anual caiu 20% em relação ao período de 2015 a 2018.

- TOTAL DE INVESTIMENTO EM SEGURANÇA PÚBLICA:

- Governos Dilma e Temer:
. Média: 2015 - 2018 (4 anos): R$ 1,7 bilhão;

- Governo Bolsonaro:
. Média: 2019 - 2021 (3 anos): R$ 1,9 bilhão.

- APREENSÃO DE DROGAS: 

. Nos 3 anos de Governo Bolsonaro, foi apreendida uma média anual de 2.058,3 ton de maconha e 166 ton de cocaína;

. Em 2018, para comparação, foram apreendidos 880 ton de maconha e 99 tone de cocaína. Ou seja, um aumento de 133,89% na média de apreensão de maconha e de 67,67% na apreensão de cocaína;

. Além das drogas, as Forças de Segurança apreenderam R$ 3,9 bilhões em bens do tráfico em 3 anos de Governo Bolsonaro;

. Parte disso tem sido usado para equipar as Polícias contra o próprio crime. Outra parte foi aplicada no Fundo Nacional Antidrogas para financiar a recuperação e o tratamento de dependentes químicos.

